package org.dce.ed.exobiology;

import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.util.Base64;
import java.util.zip.GZIPInputStream;

/**
 * Ported from EDMC BioScan RegionMapData.py.
 *
 * This class stores the region map in a compressed Base64 blob to avoid Java's
 * 64KB static initializer limit.
 */
public final class RegionMapData {

    private RegionMapData() {}

    /**
     * Index == regionId (0 means "no region").
     */
    public static final String[] REGIONS = new String[] {
        null,
        "Galactic Centre",
        "Empyrean Straits",
        "Ryker's Hope",
        "Odin's Hold",
        "Norma Arm",
        "Arcadian Stream",
        "Izanami",
        "Inner Orion-Perseus Conflux",
        "Inner Scutum-Centaurus Arm",
        "Norma Expanse",
        "Trojan Belt",
        "The Veils",
        "Newton's Vault",
        "The Conduit",
        "Outer Orion-Perseus Conflux",
        "Orion-Cygnus Arm",
        "Temple",
        "Inner Orion Spur",
        "Hawking's Gap",
        "Dryman's Point",
        "Sagittarius-Carina Arm",
        "Mare Somnia",
        "Acheron",
        "Formorian Frontier",
        "Hieronymus Delta",
        "Outer Scutum-Centaurus Arm",
        "Outer Arm",
        "Aquila's Halo",
        "Errant Marches",
        "Perseus Arm",
        "Formidine Rift",
        "Vulcan Gate",
        "Elysian Shore",
        "Sanguineous Rim",
        "Outer Orion Spur",
        "Achilles's Altar",
        "Xibalba",
        "Lyra's Song",
        "Tenebrae",
        "The Abyss",
        "Kepler's Crest",
        "The Void"
    };

    // Compressed binary encoding of regionmap (see RegionMapData.py):
    // [u16 rows][for each row: u16 entries][entries: u16 runLen, u16 regionId] big-endian, gzip-compressed, base64.
    private static final String REGION_MAP_B64_GZIP = "";

    private static volatile int[][][] regionMap;

    public static int[][][] getRegionMap() {
        int[][][] local = regionMap;
        if (local != null) {
            return local;
        }
        synchronized (RegionMapData.class) {
            if (regionMap == null) {
                regionMap = decodeRegionMap();
            }
            return regionMap;
        }
    }

    private static int[][][] decodeRegionMap() {
        byte[] gz = Base64.getDecoder().decode(REGION_MAP_B64_GZIP);
        byte[] raw;
        try {
            raw = gunzip(gz);
        } catch (IOException e) {
            throw new IllegalStateException("Failed to decompress region map data", e);
        }

        int pos = 0;
        int rows = readU16(raw, pos);
        pos += 2;

        int[][][] map = new int[rows][][];
        for (int z = 0; z < rows; z++) {
            int entries = readU16(raw, pos);
            pos += 2;
            int[][] row = new int[entries][2];
            for (int i = 0; i < entries; i++) {
                int runLen = readU16(raw, pos);
                pos += 2;
                int regionId = readU16(raw, pos);
                pos += 2;
                row[i][0] = runLen;
                row[i][1] = regionId;
            }
            map[z] = row;
        }

        return map;
    }

    private static int readU16(byte[] data, int offset) {
        return ((data[offset] & 0xFF) << 8) | (data[offset + 1] & 0xFF);
    }

    private static byte[] gunzip(byte[] gz) throws IOException {
        try (InputStream in = new GZIPInputStream(new ByteArrayInputStream(gz));
             ByteArrayOutputStream out = new ByteArrayOutputStream()) {
            byte[] buf = new byte[8192];
            int n;
            while ((n = in.read(buf)) >= 0) {
                out.write(buf, 0, n);
            }
            return out.toByteArray();
        }
    }
}
